      out.write("\t\t\t\t\t\t\t<p>2005년 11월 1일부터 공인인증서 사용이 의무화 되었습니다. 금감원의 전자상거래 안정성 강화정책에 따라 30만원 이상의 모든 신용카드 결제에 공인인증 사용이 의무화됩니다.</p>\r\n");
