      out.write("\t\t\t\t\t\t\t<h4>안전결제(ISP)란?</h4>\r\n");
      out.write("\t\t\t\t\t\t\t<p>쇼핑몰 이용시 고객님의 카드번호/비밀번호 등을 입력함으로써 발생될 수 있는 개인정보 유출 및 카드도용 등의 문제점을 차단해 주는 지불수단으로, 인터넷 안전결제 (ISP)비밀번호만으로 안전한 전자상거래를 할 수 있는 서비스입니다.<br>\r\n");
      out.write("\t\t\t\t\t\t\tBC/국민카드/우리카드사는 모든 전자상거래에 인터넷 안전결제를 의무화 시켰습니다. 30만원 이상 결제시는 공인인증서가 필요합니다.<br>\r\n");
      out.write("\t\t\t\t\t\t\t공인인증서가 없으신 고객님 공인인증서를 발급 받아주시기 바랍니다.</p>\r\n");
      out.write("\t\t\t\t\t\t\t<h4>인터넷 안전결제(ISP) 이런 점이 좋습니다.</h4>\r\n");
