      out.write("\t\t\t\t\t\t\t\t<li>신용카드번호,비밀번호 등 개인정보 유출 및 카드 도용 방지</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t<li>인터넷 안전결제(ISP) 인증번호만으로 간단하고 편리한 신용결제</li>\r\n");
      out.write("\t\t\t\t\t\t\t\t<li>인터넷 안전결제(ISP) 및 공인인증 확인으로 2중 보호가 되는 안전한 거래</li>\r\n");
      out.write("\t\t\t\t\t\t\t</ul>\r\n");
